    [],nt"num_tags": 0,nt"name": "environmental-sensitivity-index-esi-atlas-new-hampshire-maps-and-geographic-information-systems",nt"isopen":
    false,nt"url": null,nt"notes": "This data set comprises the Environmental
    Sensitivity Index (ESI) data for the New Hampshire coast from 2003 to 2004. ESI
    data characterize estuarine environments and wildlife by their sensitivity to spilled
    oil. The ESI data include information for three main components: shoreline habitats,
    sensitive biological resources, and human-use resources. This atlas was developed
    to be utilized within desktop GIS systems and contains GIS files and related D-base
    files. Associated files include MOSS (Multiple Overlay Statistical System) export
    files, .PDF maps, and detailed user guides and metadata.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
